!function (o) {
    "use strict";
    o(window).on("load", (function () {
        o("#spinner").empty(), o("#spinner").removeAttr("class"), o("#spinner").removeAttr("id")
    }))
}(jQuery);
var jumboHeight = $(".jumbotron").outerHeight();

function parallax() {
    var o = $(window).scrollTop();
    $(".jumbotron").css("background-position", "center " + -.2 * o + "px"), console.log(jumboHeight - o)
}

$(window).scroll((function (o) {
    parallax()
}));
